import React from 'react';
import './Stories.css';

const storiesData = [
  {
    id: 1,
    image: 'https://img-s-msn-com.akamaized.net/tenant/amp/entityid/AA1Ig316.img?w=800&h=435&q=60&m=2&f=jpg',
    caption: 'AI Robots Are Revolutionizing 2025 Tech',
  },
  {
    id: 2,
    image: 'https://img-s-msn-com.akamaized.net/tenant/amp/entityid/AA1IfVWj.img?w=800&h=435&q=60&m=2&f=jpg',
    caption: 'Breakthrough in Quantum Tech Visualized',
  },
  {
    id: 3,
    image: 'https://img-s-msn-com.akamaized.net/tenant/amp/entityid/AA1Ig7f5.img?w=800&h=435&q=60&m=2&f=jpg',
    caption: 'Future of AI Surveillance in Urban Spaces',
  },
];

const Stories = () => {
  return (
    <div className="stories-container container my-4">
      {storiesData.map((story) => (
        <div key={story.id} className="story mb-5">
          <img
            src={story.image}
            alt={story.caption}
            className="img-fluid rounded"
          />
          <div className="story-text mt-2">
            <h5>{story.caption}</h5>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Stories;
